import TodoList from "./TodoList";
import { useState } from 'react'
function App() {
  const [todos, setTodos] = useState([
    {id: 1,
    name: 'Todo 1'}
  ])
  return (
    <>
    <TodoList todos={todos}/>
    <input type="text"/>
    <button>Add todo</button>
    <button>Clear Completed Todos</button>
    <div>0 left to do</div>
    </>
  )
}
export default App;
